const GalleryImage = (props) => {
  return (
    <div>
      <img
        className={`grid-item grid-item-${props.index}`}
        data-id={props.id}
        src={props.imageSrc}
        alt={`${props.camera.full_name}-${props.date}`}
      />
      <p>Camera: {props.camera.full_name}</p>
      <p>Date: {props.date}</p>
    </div>
  );
};

export default GalleryImage;
